INSERT INTO Ships(title, is_delete, type, description, image_url)
VALUES("Starship Mk1", "Super Heavy B3", "Космический корабль", "Полностью многоразовая транспортная система, предназначенная для перевозки экипажа и грузов на околоземную орбиту, Луну и Марс. Для взлета с Земли необходима сверхтяжелая ракета-носитель. Корабль может осуществлять посадку и взлеты с Луны и Марса.", "/image/1.png", false)

